import React, { useState } from 'react';
import './Navbar.css';

const Navbar = () => {
  const [menuOpen, setMenuOpen] = useState(false);

  const toggleMenu = () => {
    setMenuOpen(!menuOpen);
  };

  return (
    <header className="navbar">
      <div className="navbar__main">
        <div className="navbar__brand">
          <img src="path-to-logo.png" alt="BrickTech Logo" className="navbar__logo" />
        </div>
        <button className="navbar__toggle" onClick={toggleMenu}>
          <div className="navbar__toggle-icon"></div>
          <span className="navbar__toggle-text">Menu</span>
        </button>
      </div>
      {menuOpen && (
        <div className="navbar__mobile-menu">
          <button className="navbar__close" onClick={toggleMenu}>&times;</button>
          <a href="#home" className="navbar__mobile-link">Home</a>
          <a href="#about" className="navbar__mobile-link">About Us</a>
          <a href="#resources" className="navbar__mobile-link">Resource Catalogs</a>
          <a href="#services" className="navbar__mobile-link">Services</a>
          <a href="#portfolio" className="navbar__mobile-link">Our Portfolio</a>
          <a href="#blog" className="navbar__mobile-link">Blog</a>
          <a href="#contact" className="navbar__mobile-link">Contact Us</a>
          <div className="navbar__contact-mobile">
            <span>Office: (718)-200-0699</span>
            <span>Cell: (718)-300-7014</span>
            <span>30+ Years Experience | Fully Licensed | Fully Insured | MBE Certified Contractor</span>
          </div>
          <button className="navbar__estimate-mobile">Free Estimate</button>
          <button className="navbar__whatsapp-mobile">Need Help? Chat with us</button>
        </div>
      )}
    </header>
  );
};

export default Navbar;
